import React, { useState } from "react";
import "./DeptRegistration.css";

function DeptRegistration() {
  const [title, setTitle] = useState("");
  const [desc, setDesc] = useState("");

  const handleTitleChange = (event) => {
    setTitle(event.target.value);
  };

  const handleDescChange = (event) => {
    setDesc(event.target.value);
  };

  const handleSubmit = (event) => {
    event.preventDefault();

    if (title.trim() === "") {
      alert("Title cannot be empty");
      return;
    }

    if (desc.trim() === "") {
      alert("Description cannot be empty");
      return;
    }

    // If all validations pass, you can proceed with form submission or further processing
    // For now, let's just log the success message
    console.log("Form submitted successfully!");
  };

  return (
    <div className="dept_container">
      <div className="dept_registration_form">
        <div className="dept_heading">
          <p>Create New Department</p>
        </div>

        <form className="dept_form" onSubmit={handleSubmit}>
          <div className="dept_input_area">
            <label htmlFor="title">Title:</label>
            <input
              type="text"
              id="title"
              name="title"
              placeholder="Enter ticket title"
              value={title}
              onChange={handleTitleChange}
              required
            />
          </div>

          <div className="dept_input_area">
            <label htmlFor="desc">Description:</label>
            <textarea
              id="desc"
              name="desc"
              placeholder="Enter ticket description"
              value={desc}
              onChange={handleDescChange}
              required
            />
          </div>

          <div className="dept_input_area">
            <label for="tickettype">Ticket Type:</label>
            <select name="tickettype" id="tickettype">
              <option value="greivance">Greivance</option>
              <option value="feedback">Feedback</option>
            </select>
          </div>

          <div className="dept_input_area">
            <label for="depttype">Dept Type:</label>
            <select name="dept" id="dept">
              <option value="it">IT</option>
              <option value="hr">HR</option>
              <option value="infrastructure">Infrastructure</option>
              <option value="accounts">Accounts</option>
            </select>
          </div>

          <div className="dept_input_area">
            <label for="status">Ticket Status:</label>
            <select name="status" id="status" disabled>
              <option value="open">Open</option>
              <option value="progress">Progress</option>
              <option value="closed">Closed</option>
            </select>
          </div>
          <div className="dept_registration_form_btn">
            <input type="submit" value="Register" />
          </div>
        </form>
      </div>
    </div>
  );
}

export default DeptRegistration;
